export default function Icon({ icon, ...props }) {
    const IconComponent = _icons[icon];
    if (!IconComponent) {
        console.error(`Icon "${icon}" not found. Ensure it matches a key in _icons.`);
        return null;
    }
    return <IconComponent {...props} />;
}